// 创建“外壳”组件APP
import React, { Component } from 'react';
import Hello from './conponent/Hello/Hello.js';

// 创建并暴露App组件
export default class App extends Component {
	render() {
		return (
			<div>
				<Hello />
			</div>
		);
	}
}
